class Rate extends React.Component {
  render() {
     const starArray = [1, 2, 3, 4, 5]
     return <div>
{starArray.map(element => this.props.LogementRating <= element ? <img src={FullRateStar}></img> : <img src={EmptyRateStar}></img> )}
     </div>
  }
}

export default Rate;
